import React,{useEffect} from 'react';

const AuctionHouse = () => {
    useEffect(() => {
        return axios
            .get('resource/get_all_resources_by_company/'+company, {

              //headers: { Authorization: ` ${this.getToken()}` }
            })
            .then(response => {
              console.log(response)
              return response.data
            })
            .catch(err => {
              console.log(err)
            })
    }, [])

    return (<div>Auction House Module</div>)

};

export default {
    routeProps: {
        path: '/auction_house',
        component: AuctionHouse
    },
    name: 'AuctionHouse',
}
